import React from "react"
import SearchBar from "./../components/SearchBar"
import { drawSongsSection } from "./../utils/utils"

function drawAlphabet() {
  return alphabet.map((letter) => <a href={`#${letter}`}>{letter}</a>)
}

export default function Songs(props) {
  let { SongsList } = props

  return (
    <section className="container-md">
      <div className="row">
        <div className="col-12">
          <SearchBar />
        </div>
      </div>

      <div className="row">
        <div className="col-11 songs">
          <div className="row" id="songs">
            {drawSongsSection(Object.values(SongsList))}
          </div>
        </div>

        <div className="col-1 position-fixed alphabet" id="alphabet">
          {drawAlphabet()}
        </div>
      </div>
    </section>
  )
}
